import React from 'react';

const TableComponent = ({ serverResponse }) => {
    if (!serverResponse) {
        return <p>No data available.</p>;
    }

    // Example: Assuming serverResponse contains an array of objects in StepwiseFilteredData
    const { StepwiseFilteredData } = serverResponse;

    if (!StepwiseFilteredData || StepwiseFilteredData.length === 0) {
        return <p>No relevant data found.</p>;
    }

    return (
        <table className="table table-striped">
            <thead>
                <tr>
                    <th>#</th>
                    <th>Region</th>
                    <th>Value</th>
                </tr>
            </thead>
            <tbody>
                {StepwiseFilteredData.map((item, index) => (
                    <tr key={index}>
                        <td>{index + 1}</td>
                        <td>{item.region}</td>
                        <td>{item.value}</td>
                    </tr>
                ))}
            </tbody>
        </table>
    );
};

export default TableComponent;
